<html>
<head>
<meta name="viewport" content="width=device-width, initial-scale=1.0, user-scalable=no">
<meta charset="UTF-8">
<style type="text/css">
  html, body, #map_canvas {
    margin: 0;
    padding: 0;
    height: 100%;
    font-family: Helvetica, Sans-Serif;
  }
  #container{
    padding: 40px;
  }
  #container h1{
    padding: 0;
    margin: 0;
  }
  #container svg{
    width: 60%;
    float: left;
    background: white;
  }
  #sidebar{
    width: 36%;
    float: right;
  }
  #sidebar p{
    font-size: 1.3498em;
  }
  #droptargets{
    background: rgba(166,3,17,.2);
    width: 100%;
    height: 70px;
    padding: 10px;
  }
  #droptargets span{
    display: block;
    width: 20%;
    text-align: center;
    margin: 0;
    float: left;
    font-size: 2em;
    line-height: 2em;
  }
  #target1, #target2{
    width: 40%;
    float: left;
    height: 70px;
    background: rgba(166,3,17,.4);
    font-size: 6px;
    line-height: 6px;
  }
  #target1 span, #target2 span{
    width: 100%;
    display: block;
  }
  #target2{
    float: right;
  }
  #datasets ul{
    list-style: none;
    padding: 0;
  }
  #datasets li{
    display: block;
    padding: 6px 12px 12px 12px;
    margin-bottom: 1px;
  }
  #datasets .categories>li{
    background: rgba(166,3,17,.2);
  }
  #datasets .categories>li>span{
    display: block;
    padding-bottom: 6px;
    cursor: pointer;
  }
  #datasets .datatypes li{
    background: rgba(166,3,17,.6);
    color: white;
    margin-bottom: 1px;
    cursor: move;
  }
</style>
